ISLAMABAD, Feb 12 (APP): A delegation of the Pakistan Tehreek-e-Insaf, comprising Rauf Hassan and Umair Niazi, called on President Dr Arif Alvi at the Aiwan-e-Sadr.
In the meeting, the PTI delegation discussed with the president the matters related to the recently-held general elections, a President House press release said.
